--
-- Estructura de tabla para la tabla EQUIPO
--

CREATE TABLE EQUIPO (
  ID_EQUIPO NUMBER NOT NULL,
  NOMBRE VARCHAR2(30) NOT NULL,
  CIUDAD VARCHAR2(40) NOT NULL,
  PAGINA_WEB VARCHAR2(50),
  PUNTOS NUMBER NOT NULL,
  CONSTRAINT PK_EQUIPO PRIMARY KEY (ID_EQUIPO)
);

COMMENT ON TABLE EQUIPO IS 'Datos de los equipos de baloncesto de la liga ACB';
COMMENT ON COLUMN EQUIPO.ID_EQUIPO IS 'Identificador del equipo de baloncesto';
COMMENT ON COLUMN EQUIPO.NOMBRE IS 'Nombre del equipo de baloncesto';
COMMENT ON COLUMN EQUIPO.CIUDAD IS 'Ciudad el equipo de baloncesto';
COMMENT ON COLUMN EQUIPO.PAGINA_WEB IS 'Pagina web del equipo de baloncesto';
COMMENT ON COLUMN EQUIPO.PUNTOS IS 'Puntos que lleva el equipo de baloncesto en la liga';

