--
-- Estructura de tabla para la tabla JUGADOR
--

CREATE TABLE JUGADOR (
  ID_JUGADOR NUMBER NOT NULL,
  NOMBRE VARCHAR2(20) NOT NULL,
  APELLIDOS VARCHAR2(30) NOT NULL,
  POSICION VARCHAR2(10) NOT NULL,
  ALTURA NUMBER(3,2) NOT NULL,
  PESO NUMBER NOT NULL,
  SALARIO NUMBER,
  FECHA_NACIMIENTO DATE ,
  NUMERO_CAMISETA NUMBER NOT NULL,
  ID_EQUIPO NUMBER NOT NULL,
  CONSTRAINT PK_JUGADOR PRIMARY KEY (ID_JUGADOR),
  CONSTRAINT FK_JUGADOR_ID_EQUIPO FOREIGN KEY (ID_EQUIPO) REFERENCES EQUIPO(ID_EQUIPO)
);

COMMENT ON TABLE JUGADOR IS 'Datos de los jugadores que pertenecen a un equipo';
COMMENT ON COLUMN JUGADOR.ID_JUGADOR IS 'Identificador del jugador';
COMMENT ON COLUMN JUGADOR.NOMBRE IS 'Nombre del jugador';
COMMENT ON COLUMN JUGADOR.APELLIDOS IS 'Apellidos del jugador';
COMMENT ON COLUMN JUGADOR.POSICION IS 'Posicion que ocupa el jugador en la pista';
COMMENT ON COLUMN JUGADOR.ALTURA IS 'Altura del jugador';
COMMENT ON COLUMN JUGADOR.PESO IS 'Peso del jugador';
COMMENT ON COLUMN JUGADOR.SALARIO IS 'Salario del jugador';
COMMENT ON COLUMN JUGADOR.FECHA_NACIMIENTO IS 'Fecha de nacimiento del jugador';
COMMENT ON COLUMN JUGADOR.NUMERO_CAMISETA IS 'Numero que tiene el jugador en la camiseta';
COMMENT ON COLUMN JUGADOR.ID_EQUIPO IS 'Equipo al que pertenece el jugador';


