--
-- Estructura de tabla para la tabla JUEGO
--

CREATE TABLE JUEGO (
  ID_JUEGO NUMBER NOT NULL,
  ID_EQUIPO_LOCAL NUMBER NOT NULL,
  ID_EQUIPO_FUERA NUMBER NOT NULL,
  ID_ARBITRO NUMBER NOT NULL,
  PUNTOS_EQUIPO_LOCAL NUMBER,
  PUNTOS_EQUIPO_FUERA NUMBER,
  FECHA_JUEGO DATE NOT NULL,
  CONSTRAINT PK_JUEGO PRIMARY KEY (ID_JUEGO),
  CONSTRAINT FK_JUEGO_ID_EQUIPO_LOCAL FOREIGN KEY (ID_EQUIPO_LOCAL) REFERENCES EQUIPO(ID_EQUIPO),
  CONSTRAINT FK_JUEGO_ID_EQUIPO_FUERA FOREIGN KEY (ID_EQUIPO_FUERA) REFERENCES EQUIPO(ID_EQUIPO),
  CONSTRAINT FK_JUEGO_ID_ARBITRO FOREIGN KEY (ID_ARBITRO) REFERENCES ARBITRO(ID_ARBITRO)
);

COMMENT ON TABLE JUEGO IS 'Datos de los partidos jugados por los equipos';
COMMENT ON COLUMN JUEGO.ID_JUEGO IS 'Identificador del Juego';
COMMENT ON COLUMN JUEGO.ID_EQUIPO_LOCAL IS 'Identificador del Equipo local';
COMMENT ON COLUMN JUEGO.ID_EQUIPO_FUERA IS 'Identificador del Equipo de fuera';
COMMENT ON COLUMN JUEGO.ID_ARBITRO IS 'Identificador del arbitro';
COMMENT ON COLUMN JUEGO.PUNTOS_EQUIPO_LOCAL IS 'Puntos del equipo local en este juego';
COMMENT ON COLUMN JUEGO.PUNTOS_EQUIPO_FUERA IS 'Puntos del equipo de fuera en este juego';
COMMENT ON COLUMN JUEGO.FECHA_JUEGO IS 'Fecha del Juego';

